package io.coolgc.validstring.test;

import io.coolgc.validstring.ValidString;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class ValidStringTest {

    ValidString v = new ValidString();
    static final String YES = "YES";
    static final String NO = "NO";


    @Test
    void isValidAtFirst() {
        String s = "abcdfghhgfedecba";
        assertEquals( ValidStringTest.YES,ValidString.isValid(s));
    }

    @Test
    void NotValidWithTwoFrequencies() {
        String s = "fffeeff";
        assertEquals(ValidStringTest.NO,ValidString.isValid(s));
    }

    @Test
    void ValidDeletingOneInstance() {
        String s = "dddaaauuuoood";
        assertEquals(ValidStringTest.YES,ValidString.isValid(s));
    }

    @Test
    void NotValidWithMoreThanTwoDifferentFrequencies() {
        String s = "aaaggggabbtrrtooccobblww";
        assertEquals(ValidStringTest.NO,ValidString.isValid(s));

    }

    @Test
    void EmptyString() {
        String s = "";
        assertEquals(ValidStringTest.NO,ValidString.isValid(s));

    }

    @Test
    void ValidBigString() {
        String s = "";
        assertEquals(ValidStringTest.YES,ValidString.isValid(s));

    }

    @Test
    void NotValidTest0() {
        String s = "aabbcd";
        assertEquals(ValidStringTest.NO,ValidString.isValid(s));

    }

    @Test
    void NotValidTest1() {
        String s = "aabbccddeefghi";
        assertEquals(ValidStringTest.NO,ValidString.isValid(s));

    }

    @Test
    void validTest3() {
        String s = "abcdefghhgfedecba";
        assertEquals(ValidStringTest.YES,ValidString.isValid(s));

    }

    @Test
    void validTestTwoFrequencies() {
        String s = "fafafafafafafafafar";
        assertEquals(ValidStringTest.YES,ValidString.isValid(s));

    }



}